import Login from "./Login";
import {useState} from "react";





function Home() {
    const [login, setLogin] = useState(false)

    function logIn(){
        setLogin(true)
    }

    function logOut(){
        setLogin(false)
    }

    return (
        <div>
            <h1>Welcome to home page</h1>
            <div>
                <Login login={logIn} logout={logOut}/>
            </div>
        </div>

    );
}

export default Home;
